import React from "react";
import '../sliders/slider.css';

export default function Slider(props) {
const {slides} = props;



    
    return (
        <div className="slider">
            <div className="slide">
                {
                    slides.map(
                        slide => {
                            return <img className="sliderImg"key = {slide} src={slide.image}/>; 
                            
                            
                        }
                    )
                }
            </div>
        </div>
    )
}
